var router = new VueRouter({
    mode: "history", base: "Home", routes: [{
          name: "Default", path: "/", component: ContractsListing
        }, {
          name: "Index", path: "/Index", component: ContractsListing
        }]
  }),
  vm;
Vue.use(VueRouter);
Vue.use(VeeValidate);
vm = new Vue({
  el: "#app", router: router, mounted: function()
    {
      this.$data.role = getCookie("role")
    }, data: {role: ""}, computed: {IsReadOnly: function()
      {
        return this.$data.role == "ReadOnly" ? !0 : !1
      }}
});